column8:
可愛いブタのF-05F TPU ケース。カラーも豊富♪<br><br><table border="0" cellpadding="2" cellspacing="0" width="400"><tbody> <tr>
      <td bgcolor="#cccccc">　商品特長</td>
    </tr>
    <tr>
      <td><br>
      <font size="2">Plus-s(プラスエス)シリーズは、TPU製カバーをベースに、高品質UV硬化型インクにてプリント！商品加工すべてを日本国内の熟練した職人の手作業で行われます。made in japan<br>
      <br>
      こちらはやわらかい素材のTPUケースです。 TPUは、シリコンより硬く丈夫な上に、衝撃も吸収しやすい軟性のある素材です。印刷は、UV硬化型インクにて高品質プリントを施すことにより、高級感ある仕上がりとなっております。<BR>
      <BR>
      TPUケースは長く使用している間に変色する場合ございます。また、衣服などの色移りする場合がございます。ご了承のうえ、ご購入下さい。 <BR>
      <br>
      </font></td>
    </tr>
    <tr>
      <td align="center">&nbsp;<img src="http://image.rakuten.co.jp/kintsu/cabinet/plus-s/explanation_plus-s.jpg" /><br>
      <br>
      </td>
    </tr>
    <tr><td align="left" bgcolor="cccccc">　商品説明</td></tr><tr><td align="left"><br><font size="2" color="#404040">・スマートフォンケース側面への印刷は入りません。<br>
      ・装着したまま充電可能（卓上ホルダには対応しません）です。<br>
      ・ベースのスマートフォンケースは、複数の仕入れ先より入手しており、入荷時期によって形状が若干変わる事があります。<br>
      </font>
      <hr>
      <font size="2" color="#404040">素材：ケース本体／TPU<br>
      加工：UV硬化型インク（側面にプリントは入りません）<br>
      対応機種・サイズ：F-05F専用<br>
      </font>
      <hr>
      <font size="2" color="#404040">※機種本体は含まれておりません。<br>
      ※仕様は予告なく変更する場合がございます。</font></td></tr></tbody></table><style type="text/css">
